function eval_ior_data() {
    var data = { x: [], y: [], marker: { color: [] }};
    for(var k=0; k<ior_data_points.length; ++k) {
        data.x[k] = ior_data_points[k][1];;
        data.y[k] = ior_data_points[k][2];;
        data.marker.color[k] = 'rgb(' + 256*ior_data_points[k][4] + ',' + 256*ior_data_points[k][5] + ',' + 256*ior_data_points[k][6] + ')';
    }
    data.name = 'refractive-index.info data'
    data.mode = 'markers'
    data.type = 'scatter'
    return data;
}

function gulbrandsen_param_ior(K=100, L=20) {
    var datas = [];
    for(var l=0; l<L; ++l) {
        var data = { x: [], y: []};
        for(var k=0; k<K; ++k) {
            const r = k / (K-1);
            const g = l / (L-1);
            var nk = RGtoNK(r, g);
            data.x[k] = nk[0];
            data.y[k] = nk[1];
        }
        data.line = {
            color: 'rgb(200,20,0)',
            width: 0.5
        }
      
        datas[l] = data;
    }

    for(var l=0; l<L; ++l) {
        var data = { x: [], y: []};
        for(var k=0; k<K; ++k) {
            const g = k / (K-1);
            const r = l / (L-1);
            var nk = RGtoNK(r, g);
            data.x[k] = nk[0];
            data.y[k] = nk[1];
        }
        data.line = {
            color: 'rgb(0,20,200)',
            width: 0.5
        }

        datas[L+l] = data;
    }
    return datas;
}

